import { StyleSheet} from 'react-native';

const styles = StyleSheet.create({
  
    container: {
      marginTop: '5%',
      flex: 1,
    },
    image_login:{
      alignSelf:'center',
      marginTop:5,
      width:'35%',
      height:'15%',
      resizeMode: 'stretch',
    },
    title: {
      color: '#263238',
      fontSize: 26,
      lineHeight: 35,
      fontWeight: 'bold',
      marginTop: 5,
      textAlign: 'center'
    },
    subTitle: {
      color: '#9E9E9E',
      fontSize: 16,
      marginTop: 15,
      lineHeight: 22,
      textAlign: 'center'
    },
    content:{
      backgroundColor:'#DA5C5C',
      marginHorizontal:30,
      marginTop:20,
      paddingVertical:15,
      borderRadius: 10,
      flex:1,
     // height:'55%',
      justifyContent:'space-evenly',
    },
    text_Input:{
      backgroundColor: "#fff",
      width: '90%',
      height:50,
      marginBottom:15,
      alignSelf: 'center',
      borderRadius: 10,
      paddingLeft: 20,
      shadowColor: '#000',
      shadowOffset: { width: 1, height: 1 },
      shadowOpacity: 0.7,
      shadowRadius: 2,
      elevation: 3,
    },
    footer: {
      marginTop: '10%',
      alignItems: 'center',
      
    },
    button: {
      backgroundColor: '#DA5C5C',
      flexDirection: 'row',
      width:'60%',
      alignItems:'center',
      justifyContent:'center',
      borderRadius: 10,
      marginBottom:15,
    },
    buttonText: {
      paddingTop: 15,
      paddingBottom: 15,
      paddingLeft: 50,
      paddingRight: 50,
      fontWeight: 'bold',
      fontSize: 18,
      color: '#FFF',
      letterSpacing: -0.24,
    }
  
});
export default styles;
